{
  "name": "UBX-CFG-NAV5",
  "class_id": "0x06",
  "message_id": "0x24",
  "description": "Navigation engine settings",
  "message_type": "get_set",
  "payload_length": {
    "fixed": 36
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "X2",
      "name": "mask",
      "description": "Parameters bitmask. Only the masked parameters will be applied.",
      "sub_fields": [
        {
          "bit_offset": 0,
          "data_type": "U:1",
          "name": "dyn",
          "description": "Apply dynamic model settings"
        },
        {
          "bit_offset": 1,
          "data_type": "U:1",
          "name": "minEl",
          "description": "Apply minimum elevation settings"
        },
        {
          "bit_offset": 2,
          "data_type": "U:1",
          "name": "posFixMode",
          "description": "Apply fix mode settings"
        },
        {
          "bit_offset": 3,
          "data_type": "U:1",
          "name": "drLim",
          "reserved": true,
          "description": "Reserved (apply DR limit settings, only applicable for protocol versions less than 14.00)"
        },
        {
          "bit_offset": 4,
          "data_type": "U:1",
          "name": "posMask",
          "description": "Apply position mask settings"
        },
        {
          "bit_offset": 5,
          "data_type": "U:1",
          "name": "timeMask",
          "description": "Apply time mask settings"
        },
        {
          "bit_offset": 6,
          "data_type": "U:1",
          "name": "staticHoldMask",
          "description": "Apply static hold settings"
        },
        {
          "bit_offset": 7,
          "data_type": "U:1",
          "name": "dgpsMask",
          "description": "Apply DGPS settings"
        },
        {
          "bit_offset": 8,
          "data_type": "U:1",
          "name": "cnoThreshold",
          "description": "Apply CNO threshold settings (cnoThresh, cnoThreshNumSVs) (not supported for protocol versions less than 14.00)"
        },
        {
          "bit_offset": 9,
          "data_type": "U:1",
          "name": "reservedBit9",
          "reserved": true,
          "description": "Reserved"
        },
        {
          "bit_offset": 10,
          "data_type": "U:1",
          "name": "utc",
          "description": "Apply UTC settings (not supported for protocol versions less than 16.00)"
        },
        {
          "bit_offset": 11,
          "data_type": "U:1",
          "name": "reservedBit11",
          "reserved": true,
          "description": "Reserved"
        },
        {
          "bit_offset": 12,
          "data_type": "U:1",
          "name": "reservedBit12",
          "reserved": true,
          "description": "Reserved"
        },
        {
          "bit_offset": 13,
          "data_type": "U:1",
          "name": "reservedBit13",
          "reserved": true,
          "description": "Reserved"
        },
        {
          "bit_offset": 14,
          "data_type": "U:1",
          "name": "reservedBit14",
          "reserved": true,
          "description": "Reserved"
        },
        {
          "bit_offset": 15,
          "data_type": "U:1",
          "name": "reservedBit15",
          "reserved": true,
          "description": "Reserved"
        }
      ]
    },
    {
      "byte_offset": 2,
      "data_type": "U1",
      "name": "dynModel",
      "description": "Dynamic platform model: 0 = portable, 2 = stationary, 3 = pedestrian, 4 = automotive, 5 = sea, 6 = airborne with <1g acceleration, 7 = airborne with <2g acceleration, 8 = airborne with <4g acceleration, 9 = wrist-worn watch (not supported for protocol versions less than 18.00), 10 = motorbike (supported for protocol versions 19.20, and 35.10), 11 = robotic lawn mower (supported for protocol versions 33.21), 12 = electric kick scooter (supported for protocol versions 33.21, and 35.10)"
    },
    {
      "byte_offset": 3,
      "data_type": "U1",
      "name": "fixMode",
      "description": "Position fixing mode: 1 = 2D only, 2 = 3D only, 3 = auto 2D/3D"
    },
    {
      "byte_offset": 4,
      "data_type": "I4",
      "name": "fixedAlt",
      "scale": {
        "raw": "0.01",
        "multiplier": 0.01
      },
      "unit": "m",
      "description": "Fixed altitude (mean sea level) for 2D fix mode"
    },
    {
      "byte_offset": 8,
      "data_type": "U4",
      "name": "fixedAltVar",
      "scale": {
        "raw": "0.0001",
        "multiplier": 0.0001
      },
      "unit": "m^2",
      "description": "Fixed altitude variance for 2D mode"
    },
    {
      "byte_offset": 12,
      "data_type": "I1",
      "name": "minElev",
      "unit": "deg",
      "description": "Minimum elevation for a GNSS satellite to be used in NAV"
    },
    {
      "byte_offset": 13,
      "data_type": "U1",
      "name": "drLimit",
      "unit": "s",
      "reserved": true,
      "description": "Reserved (maximum time to perform dead reckoning (linear extrapolation) in case of GPS signal loss, only applicable for protocol versions less than 14.00)"
    },
    {
      "byte_offset": 14,
      "data_type": "U2",
      "name": "pDop",
      "scale": {
        "raw": "0.1",
        "multiplier": 0.1
      },
      "description": "Position DOP mask to use"
    },
    {
      "byte_offset": 16,
      "data_type": "U2",
      "name": "tDop",
      "scale": {
        "raw": "0.1",
        "multiplier": 0.1
      },
      "description": "Time DOP mask to use"
    },
    {
      "byte_offset": 18,
      "data_type": "U2",
      "name": "pAcc",
      "unit": "m",
      "description": "Position accuracy mask"
    },
    {
      "byte_offset": 20,
      "data_type": "U2",
      "name": "tAcc",
      "description": "Time accuracy mask"
    },
    {
      "byte_offset": 22,
      "data_type": "U1",
      "name": "staticHoldThresh",
      "unit": "cm/s",
      "description": "Static hold threshold"
    },
    {
      "byte_offset": 23,
      "data_type": "U1",
      "name": "dgnssTimeout",
      "unit": "s",
      "description": "DGNSS timeout (not supported for protocol versions less than 13.00)"
    },
    {
      "byte_offset": 24,
      "data_type": "U1",
      "name": "cnoThreshNumSVs",
      "description": "Number of satellites required to have C/NO above cnoThresh for a fix to be attempted (not supported for protocol versions less than 14.00)"
    },
    {
      "byte_offset": 25,
      "data_type": "U1",
      "name": "cnoThresh",
      "unit": "dBHz",
      "description": "C/NO threshold for deciding whether to attempt a fix (not supported for protocol versions less than 14.00)"
    },
    {
      "byte_offset": 26,
      "data_type": {
        "array_of": "U1",
        "count": 2
      },
      "name": "reserved0",
      "reserved": true,
      "description": "Reserved"
    },
    {
      "byte_offset": 28,
      "data_type": "U2",
      "name": "staticHoldMaxDist",
      "unit": "m",
      "description": "Static hold distance threshold (before quitting static hold) (not supported for protocol versions less than 15.00)"
    },
    {
      "byte_offset": 30,
      "data_type": {
        "array_of": "U1",
        "count": 6
      },
      "name": "reserved1",
      "reserved": true,
      "description": "Reserved"
    }
  ]
}
